import './App.css';
import {BrowserRouter} from "react-router-dom";
import {Routes, Route} from "react-router";
import HelloProject from "./users/register";
import searchComponent from "./search/searchC";
function App() {
  return (
      <BrowserRouter>
        <div className="container">
          <Routes>
              <Route index element={<searchComponent/>}/>
              <Route path="/search" element={<searchComponent/>}/>
              <Route path="/register" element={<HelloProject/>}/>
          </Routes>
        </div>
      </BrowserRouter>
  );
}

export default App;
